class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        longest = 0
        sub = []
        for k, v in enumerate(s):
            if v not in sub:
                sub.append(v)
            else:
                longest = max(longest, len(sub))
                sub = sub[sub.index(v)+1:len(sub):1]
                sub.append(v)
            longest = max(longest, len(sub))
        return longest


